function Posts({ stories }) {

    console.log(stories)

    const mappedStories = stories.map(story => {
        return (
                <h3 key={story.id}>{story.content}</h3>
        )
    })

    return (
        <div>
            {mappedStories}
        </div>
    );
}

export default Posts;
